class Calculator extends Component {
    render() {
        return (
            <div>
                <h1>340.</h1>
                <hr/>
                <ul>
                    <li></li>
                    <li></li>
                </ul>
                <hr/>
                <button></button>
                <button></button>
            </div>
        )
    }
}
export default Calculator;
